if __name__ == '__main__':
    fileB=[]
    fileB1 = ['xalan', 'log4j', 'xerces', 'poi', 'velocity', 'synapse', 'ant', 'redaktor', 'arc', 'ivy', 'camel']

    font = {
        'size': 50}

    plt.rc('font', **font)
    paras = {'lines.linewidth': 8, 'legend.fontsize': 45, 'axes.labelsize': 70, 'legend.frameon': False,
             'figure.autolayout': True}
    plt.rcParams.update(paras)

    measure_med = {}
    measure_iqr = {}
    measure_med_tun={}
    smote=OrderedDict()
    nosmote=OrderedDict()
    tuning = OrderedDict()
    l = ["Recall", "Precision", "Accuracy", "F_score","False_alarm","AUC"]
    for i in l:
        measure_med[i] = {}
        measure_iqr[i] = {}
        measure_med_tun[i] = {}
    for x in fileB1:
        smote[x]=untuned[x]
        nosmote[x]=nosmote1[x]
        tuning[x]=tuned[x]

    for f, measures in smote.iteritems():
        fileB.append(f)
        #print(fileB)
        for mea, values in measures.iteritems():
            for i,k in enumerate(values):
                try:
                    measure_med_tun[mea][k[0]].append(np.median(tuning[f][k[0]][mea])-np.median(nosmote[f][mea][i][1:]))
                    measure_med[mea][k[0]].append(np.median(k[1:])-np.median(nosmote[f][mea][i][1:]))
                    measure_iqr[mea][k[0]].append((np.percentile(k[1:], 75) - np.percentile(k[1:], 25))-(np.percentile(nosmote[f][mea][i][1:], 75) - np.percentile(nosmote[f][mea][i][1:], 25)))
                except KeyError:
                    measure_med_tun[mea][k[0]]=[np.median(tuning[f][k[0]][mea])-np.median(nosmote[f][mea][i][1:])]
                    measure_med[mea][k[0]] = [np.median(k[1:])-np.median(nosmote[f][mea][i][1:])]
                    measure_iqr[mea][k[0]] = [(np.percentile(k[1:], 75) - np.percentile(k[1:], 25))-(np.percentile(nosmote[f][mea][i][1:], 75) - np.percentile(nosmote[f][mea][i][1:], 25))]
    X = range(len(fileB))

    fileB2 = ['(99) xalan', '(92) log4j', '(74) xerces', '(63) poi', '(34) velocity', '(33) synapse', '(22) ant', '(15) redaktor', '(11) arc', '(11) ivy', '(4) camel']

    for i,j in enumerate(measure_iqr.keys()):
        plt.figure(num=i, figsize=(25, 15))
        plt.subplot(121)
        M = -1.0
        m = 1.0


        for k in measure_iqr[j].keys():
            if M < max(max(measure_med_tun[j][k]),max(measure_med[j][k])) :
                 M = max(max(measure_med_tun[j][k]),max(measure_med[j][k]))
            if m > min(min(measure_med_tun[j][k]),min(measure_med[j][k])):
                 m = min(min(measure_med_tun[j][k]),min(measure_med[j][k]))
            line,=plt.plot(X,measure_med_tun[j][k] ,marker='*', markersize=20, label=k+' tuned')
            plt.plot(X, measure_med[j][k],linestyle="-.",color=line.get_color(), markersize=20,label=k+' untuned')
            #plt.ytext(0.04, 0.5, va='center', rotation='vertical', fontsize=11)
            #plt.text(0.04, 0.5,"Rn (Raw Score)", labelpad=100)
        #box = ax.get_position()
        #ax.set_position([box.x0, box.y0, box.width * 0.8, box.height])
        plt.ylim(m, M)
        plt.xticks(X, fileB2,rotation=90)
        plt.ylabel(j, labelpad=30)
